import React from "react";
import { Nav, Navbar } from "react-bootstrap";
import { ReactComponent as Logo } from "../images/TM-logo.svg";
// import { LinkContainer } from "react-router-bootstrap";

function NavbarPage() {
  return (
    <div>
      <Navbar className="navItem " expand="lg">
        <Navbar.Brand href="./App.js">
          <Logo />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav
            className="justify-content-end flex-grow-1 pe-3 navItem grayColor "
            activeKey={window.location.pathname}
          >
            <Nav.Link eventKey={2} className="naveLink " href="./App.js">
              Home
            </Nav.Link>
            <Nav.Link className="naveLink" href="./FeaturePage.jsx">
              Features
            </Nav.Link>
            <Nav.Link className="naveLink" href="./DownloadPage.jsx">
              Apps
            </Nav.Link>
            <Nav.Link className="naveLink" href="./ReviewPage.jsx">
              Testimonials
            </Nav.Link>
            {/* <LinkContainer to="./Footer.jsx">
              <Nav.Link>About Us</Nav.Link>
            </LinkContainer> */}
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
}

export default NavbarPage;
